import React from 'react'

const ArtModal = ({showModal, setShowModal, image}) => {
  return (
    <>
        {showModal ? 
        <div className='fixed top-0 left-0 right-0 inset-0 bg-gray-500 bg-opacity-75 transition-opacity'>
            <div className="border-black border-8 bg-white fixed flex-col inset-0 z-10 h-screen justify-center p-4 sm:items-center sm:p-0">
                <img className="h-[80%] mx-auto my-5" src={image}></img> 
            </div>
        </div> 
        : null}
    </>
    
  )
}

export default ArtModal
